import React from "react";
import { Link } from "react-router-dom";
import Searchbox from "../searchbox/searchbox";
import './edit.css'

export default function Edit() {
  return (
    <>
      <Link to='/'>
        <div id="go-back"><i class="fa-solid fa-arrow-left"></i></div>
      </Link>
      <Searchbox key='searchbox'/>
    </>
  )
}
